import { useTable } from 'react-table'

function ReactTable(){
    const data = React.useMemo(
        () => [
          {
            col1: 'Hello',
            col2: 'World',
          },
          {
            col1: 'react-table',
            col2: 'rocks',
          },
          {
            col1: 'whatever',
            col2: 'you want',
          },
        ],
        []
      )
   
    return(
        <></>
    )
}

export default ReactTable
